import axios from "axios";

export const create = async ({ host, port, password, game }) => {
  try {
    return await axios.post(
      "/",
      {
        host,
        port,
        password,
        game
      },
      {
        withCredentials: true
      }
    );
  } catch (err) {
    return err;
  }
};
